import React from "react";
import './Home.css';
import Title from './images/Title.svg';
import Logo from "./images/logo1.svg";

    const Home = () => {
        return (<div>
            <img src={Title} alt="Africa bégué Desktop"></img>
            <div>
                <h3>Entrez dans la Danse !</h3>
                <img src={Logo} alt="logo" class="logo"></img>
            </div>
        </div>
        )
        }

export default Home;
